import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Row, Col, Button, Card, ListGroup, Badge, Alert, ProgressBar, Spinner, Table, Form, InputGroup, FormControl } from 'react-bootstrap';

const Services = () => {
  return (
    <div className="services-page-container">
      <Container>
        <Row>
          <Col>
            <h1>Our Services</h1>
            <Card>
              <Card.Body>
                <Card.Title>Service 1</Card.Title>
                <Card.Text>
                  This is a description of service 1.
                </Card.Text>
                <Button variant="primary">Learn more</Button>
              </Card.Body>
            </Card>
            
          </Col>
        </Row>  
      </Container>
    </div>
  );
};

export default Services;
